# fonction qui pour un mot cre un dictionnaire avec comme cls chaque lettre du mot et comme valeur les positions de chacune des lettres dans le mot
def compterLettres(mot_recherche):
    """cre un dictionnaire qui indique la position de chaque lettre dans un mot"""
    dict={}
    for lettre in mot_recherche:
        """leteste si la lettre existe dj dans le dico sinon le cre"""
        if lettre in dict:
            liste_index=dict[lettre]
            position=liste_index[-1]
            liste_index.append(mot_recherche.index(lettre,position+1))
            dict[lettre]=liste_index
        else:
            liste_index=[]
            liste_index.append(mot_recherche.index(lettre))
            dict[lettre]=liste_index

    return dict

